import React, { Component } from 'react';
import { NavLink } from 'react-router-dom'

export default class MyNavLink extends Component {
    render() {
        return (
            <NavLink activeClassName="dup-active-list-item" className="dup-list-item" {...this.props} />
        )
    }
}
